import './colors.css';
import { BrowserRouter } from 'react-router-dom';
import LoginPage from './login/LoginPage';

function App() {
  return (
    <BrowserRouter>
      <LoginPage />
      <Route>
      <Route path="/register" component={RegisterPage} />
      </Route>
      </BrowserRouter>
  );
}

export default App;
